var minMoves = function(nums, limit) {
  let obj = {}
  let length = nums.length
  for (let i=0;i<length / 2;i+=1) {
      let sum = nums[i] + nums[length -1 - i]
      obj[sum] = obj[sum] ? obj[sum] + 1 : 1
  }
  let maxCount = 0
  let total = 9999999
  let candidate = []
  for (let [key, value] of Object.entries(obj)) {
      if (value >= maxCount) {
          maxCount = value
          if (+value === +maxCount) {
              candidate.push(+key)
          } else {
              candidate = [+key]
          }
      }
  }
  
  console.log(candidate)

  let minCount = 9999999
  for (let j = 0; j<candidate.length;j++) {
      let total = candidate[j]
      let count = 0
      for (let i=0;i<length / 2;i+=1) {
          let sum = nums[i] + nums[length -1 - i]
          console.log('sum: ', sum)
          if (sum !== +total) {
              console.log(nums[i], nums[length -1 - i])
              if (sum <= limit) {
                  if (nums[i] + limit < total && limit + nums[length -1 - i] < total) {
                      count += 2
                  } else {
                      count += 1
                  }
              } else if (sum > limit) {
                  if (nums[i] + 1 > total && 1 + nums[length -1 - i] > total) {
                      count += 2
                  } else {
                      count += 1
                  }
              }
          }
      }
      if (count < minCount) {
          minCount = count
      }
  }
  return minCount
};
